import React, { Component } from "react";

export default class Count extends Component {
  render() {
    return (
      <div>
        <h1>当前求和为：0</h1>
        <select value="0">
          <option value="1"></option>
          <option value="2"></option>
          <option value="3"></option>
          <option value="4"></option>
        </select>
        <button>+</button>
        <button>-</button>
        <button>当前求和为奇数再加</button>
        <button>异步加</button>
      </div>
    );
  }
}
